import { gql } from '@apollo/client';

export const fetch_posts_query = gql`
query fetchPosts($input:FetchPostInput) {
 fetchPosts(input: $input){  
    id
   body
   user_id
   name
   likes{
     liker_name
     liker_id
     liker_email
   }
   }
}`
